import React from "react";
import '../styles/Button.css';

export default props => {

let classes = `
${classes =+ props.operation ? 'operation' : ''}
${props.double ? 'double' : ''}
${props.triple ? 'triple': ''}
`
return(<button className={classes}>
{props.label}
</button>
)
}
